                  <div className="popup">
                    <h3>{entry.title}</h3>
                    <p>{entry.comments}</p>
                    <small>Visited on: {new Date(entry.visitDate).toLocaleDateString()}</small>
                    {entry.image && <p><img src={entry.image} alt={entry.title} width='200px' height='100px' /></p>
                    }
                  </div>
                </Popup>
              ) : null
            }
          </React.Fragment>
        ))
